import LevelTicker from "./LevelTicker"
import UserTicker from "./UserTicker"
import defaultUserImage from "../../hamster.svg";
function MainScreen(){
let dummyUser = {name: "Jack Conev", image: defaultUserImage, earnPerTab: 1, coinsToLevelUp: 65, profitPerHour: 12, totalCoins: 1000}
    return(
        <div className="Mainscreen">
            <UserTicker user={dummyUser}></UserTicker>
            <LevelTicker
                user={dummyUser}
            ></LevelTicker>
        </div>
    )
}

export default MainScreen
